import React from 'react';
import alina from 'assets/img/logo/alina.png';
import logoArquivo from 'assets/img/logo/arquivo.png';
import logoPaper from 'assets/img/logo/paper.png';
import logoCode from 'assets/img/logo/code.png';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardHeader from '@mui/material/CardHeader';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Typography from 'components/Typography';
import Container from '@mui/material/Container';
import Page from 'components/Page';
import 'styles/components/_sources.scss';
import FadeIn from 'components/FadeIn';

import {
  CardImg,
} from 'reactstrap';
import Row from 'reactstrap/lib/Row';


function Copyright(props) {
  return (
    <Typography className="font" style={{color:"white", borderWidth:"350px"}} variant="body2" align="center" {...props}>
      {'Copyright © 2022   Implementado na '}
      <a className="font" style={{color:"#20F624", fontWeight: "bolder"}} href="https://www.ua.pt">Universidade de Aveiro</a>
    </Typography>
  );
}

const tiers = [
  {
    title: 'Projeto',
    image: logoCode,
    description: [
      'Código-aberto do projeto',
    ],
    buttonText:  <a className="buttonText" href="https://www.ua.pt">Aceder ao projeto</a>,
    buttonVariant: 'outlined',
  },
  {
    title: 'Relatório técnico',
    image: logoPaper,
    description: [
      'Relatório técnico do projeto',,
    ],
    buttonText: <a className="buttonText" href="https://www.ua.pt">Aceder ao relatório</a>,
    buttonVariant: 'outlined',
  },
  {
    title: 'Arquivo.pt',
    image: logoArquivo,
    description: [
      'Fonte oficial dos dados',
    ],
    buttonText: <a className="buttonText" href="https://www.arquivo.pt">Aceder ao Arquivo.pt</a>,
    buttonVariant: 'outlined',
  },

];

const tiers2 = [
  {
    title: 'Alina Yanchuk',
    image: alina,
    description: [
      'Autora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Mestrado em Engenharia Informática',
  },
  {
    title: 'Alina Trifan',
    image: logoPaper,
    description: [
      'Orientadora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Investigação',
  },
  {
    title: 'José Oliveira',
    image: logoPaper,
    description: [
      'Orientador',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Professor',
  },
  {
    title: 'Olga Pereira',
    image: logoPaper,
    description: [
      'Orientadora',
    ],
    email: "alinayanchuk@ua.pt",
    cargo: 'Investigação',
  },

];




const SourcesPage = () => {
  return (
    <Page>
    <Row >
    <div style={{backgroundColor:"#f9c74f", width:"100%"}}>
      <CssBaseline />
      {/* Hero unit */}
      <FadeIn>
      <p className="authorsTitle">RECURSOS</p>
      </FadeIn> 
      <FadeIn>
      <p className="subheading">
        Os principais recursos e referências referentes a este projeto podem ser encontrados abaixo.
      </p>
      </FadeIn>
      {/* End hero unit */}
      <Container  style={{marginTop:"70px"}}>
        <Grid container spacing={6} alignItems="flex-end">
          {tiers.map((tier) => (
            // Enterprise card is full width at sm breakpoint
            <Grid
            className="font"
              item
              key={tier.title}
              xs={4}
              sm={tier.title === 'Enterprise' ? 12 : 6}
              md={3.2}
            >
              <FadeIn  delay={450}>
              <Card className='recurso'>
                <p className='font' style={{fontSize:"25px", marginLeft:"20%"}}>{tier.title}</p>
                <CardContent>
                  <Box
                    sx={{
                      display: 'flex',
                      justifyContent: 'center',
                      alignItems: 'baseline',
                      mb:2,

                    }}
                  >
                   <CardImg src={tier.image} style={{margin:20}}  />
                  </Box>
                  <p>
                    {tier.description.map((line) => (
                      <Typography
                        component="li"

                        align="center"
                        key={line}
                      >
                        {line}
                      </Typography>
                    ))}
                  </p>
                </CardContent>
                <CardActions>
                  <Button style={{borderColor:"#f9c74f", borderWidth:"2px"}} fullWidth variant={tier.buttonVariant}>
                    {tier.buttonText}

                  </Button>
                </CardActions>
              </Card>
            </FadeIn>
            </Grid>
          ))}
        </Grid>
      </Container>
      <FadeIn>
      <p style={{marginTop:"100px"}} className="authorsTitle">Contactos</p>
      </FadeIn> 

        <Row style={{marginLeft:"100px"}}>
        <FadeIn delay={450}>
        <Card className='autor'>
              <CardHeader

                title="Alina Yanchuk"

                titleTypographyProps={{variant:"h6", align: 'center' }}

                subheaderTypographyProps={{
                  align: 'center',
                }}
                sx={{
                  backgroundColor: (theme) =>
                    theme.palette.mode === 'light'
                      ? theme.palette.grey[100]
                      : theme.palette.grey[200],
                }}
              />
                <CardContent>
                  <Box

                    sx={{
                      display: 'flex',
                      justifyContent: 'center',
                      alignItems: 'baseline',
                      mb:2,

                    }}
                  >
